import "./AboutProject.css";

function AboutProject() {

    return (
    <div className ="aboutproject">
        <div className="aboutproject__container">
            <p className="aboutproject__text">О проекте</p>
            <div className="aboutproject__container-line" />
            <div className="aboutproject__text-container">
                <div className="aboutproject__text-container__text">
                    <p className="aboutproject__text-container__parts_header">Дипломный проект включал 5 этапов</p>
                    <p className="aboutproject__text-container__parts_text">Составление плана, работу над бэкендом, вёрстку, добавление функциональности и финальные доработки.</p>
                </div>
                <div className="aboutproject__text-container__text">
                    <p className="aboutproject__text-container__time_header"></p>
                    <p className="aboutproject__text-container__time_text"></p>
                </div>
            </div>
        </div>
    </div>
        );
    }
    export default AboutProject;
